import React, { useState } from 'react';

const LiftLog = () => {
  const [lifts, setLifts] = useState([
    { lift: 'deadlift' },
    { lift: 'squat' },
    { lift: 'bench press' }
  ]);

  return (
    <div id="lift-log">
      <LiftSelector />
    </div>
  );
};

const LiftSelector = () => {
  return (
    <div id="lift-selector">
      <button type="button" class="arrow-button">
        &larr;
      </button>
      <h2>SQUAT</h2>
      <button type="button" class="arrow-button">
        &#65291;
      </button>
    </div>
  );
};

export default LiftLog;
